import React, {Component} from 'react';

import  express_angelic from './brand/express_angelic.png'
import './brand.css'

import  brandimg from './brand/express_bengal_meat.png'



class Brand extends Component {
    render() {
        return (
            <div className="brand">
                   <div className="item1">
                       <img src={brandimg} alt=""/>
                   </div>
            </div>
        );
    }
}

export default Brand;
